import React from "react"
import "./home.css";
import Social from "./Social";
import Data from "./Data";
import ScrollDown from "./ScrollDown";

function Home(){
    return (
        <section className="home section" id="home">
            <div className="home__container container_ grid_">
                <div className="home__content grid_">
                    <Social />

                    <div className="home__img"></div>

                    <Data />
                </div>

                <ScrollDown />
            </div>
            <img src="./assets/semi circle.svg" class="shape shape--0" alt=""></img>
            <img src="./assets/circle.svg" class="shape shape--1"></img>
            <img src="./assets/squiggly.svg" class="shape shape--2"></img>
        </section>
    )
}

export default Home;
